import React from 'react';
import './App.css';

export default function SectionAbout() {
    const imageUrl = window.innerWidth >= 650 ? desktopImage : mobileImage;

    return (
        <div className="App" style={{backgroundImage: `url(${imageUrl})` }}>
            <div className="App-content">
                <h1>Pineapples</h1>
                <p>They are good</p>
            </div>
        </div>
    );

}
